import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { toast } from 'react-toastify';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    name: '',
    azureId: ''
  });
  const [loading, setLoading] = useState(false);
  const { login } = useAuth();
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      const result = await login(formData.email, formData.name, formData.azureId, undefined);
      
      if (result.success) {
        toast.success('Login successful');
        navigate('/');
      } else {
        toast.error('Login failed');
      }
    } catch (error) {
      toast.error('An error occurred during login');
    } finally {
      setLoading(false);
    }
  };

  const handleQuickLogin = async (email, name, role) => {
    setLoading(true);
    try {
      const result = await login(email, name, email, role);
      
      if (result.success) {
        toast.success(`Login successful as ${role}`);
        navigate('/');
      } else {
        toast.error('Login failed');
      }
    } catch (error) {
      toast.error('An error occurred during login');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="d-flex justify-content-center align-items-center min-vh-100">
      <div className="card shadow-lg" style={{ width: '500px' }}>
        <div className="card-body p-5">
          <div className="text-center mb-4">
            <i className="bi bi-ticket-perforated fs-1 text-primary"></i>
            <h2 className="mt-3">IT Support Portal</h2>
            <p className="text-muted">Login with your Microsoft account</p>
          </div>

          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label className="form-label">Email</label>
              <input
                type="email"
                className="form-control"
                value={formData.email}
                onChange={(e) => setFormData({ ...formData, email: e.target.value })}
                required
              />
            </div>

            <div className="mb-3">
              <label className="form-label">Name</label>
              <input
                type="text"
                className="form-control"
                value={formData.name}
                onChange={(e) => setFormData({ ...formData, name: e.target.value })}
                required
              />
            </div>

            <button 
              type="submit" 
              className="btn btn-primary w-100 mb-3"
              disabled={loading}
            >
              {loading ? 'Logging in...' : 'Login with Microsoft'}
            </button>
          </form>

          <hr className="my-4" />

          <div className="text-center">
            <p className="text-muted small mb-3">Quick Login (Demo Only)</p>
            <div className="d-grid gap-2">
              <button 
                className="btn btn-outline-secondary btn-sm"
                onClick={() => handleQuickLogin('employee@injala.com', 'John Employee', 'Employee')}
                disabled={loading}
              >
                {loading ? 'Logging in...' : 'Login as Employee'}
              </button>
              <button 
                className="btn btn-outline-info btn-sm"
                onClick={() => handleQuickLogin('admin@injala.com', 'IT Admin User', 'IT Admin')}
                disabled={loading}
              >
                {loading ? 'Logging in...' : 'Login as IT Admin'}
              </button>
              <button 
                className="btn btn-outline-danger btn-sm"
                onClick={() => handleQuickLogin('senior@injala.com', 'Senior Admin', 'Senior Admin')}
                disabled={loading}
              >
                {loading ? 'Logging in...' : 'Login as Senior Admin'}
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
